public SchedulerMetricsCollector(
    ExecutorService executor,
    int duration,
    TimeUnit timeUnit,
    List<MetricCollector> metricCollectors) {
  this.executor = executor;
  this.metricCollectors = metricCollectors;
  this.duration = duration;
  this.timeUnit = timeUnit;
}

